function GetDetails(n){HttpGet(`/ActionTakenByDDA/RequestForProceedingEvictionView/?id=${n}`,"html",function(n){$("#RequestForProceedingEvictionDiv").html("");$("#RequestForProceedingEvictionDiv").html(n)})}function GetNoticeDetails(n){HttpGet(`/ActionTakenByDDA/NoticeGenerationView/?id=${n}`,"html",function(n){$("#NoticeGenerationDiv").html("");$("#NoticeGenerationDiv").html(n)})}function GetEvidenceDetails(n){HttpGet(`/ActionTakenByDDA/AllotteeEvidenceView/?id=${n}`,"html",function(n){$("#AllotteeEvidenceDiv").html("");$("#AllotteeEvidenceDiv").html(n)})}function GetHearingDetails(n){HttpGet(`/ActionTakenByDDA/HearingDetailsView/?id=${n}`,"html",function(n){$("#HearingDetailsDiv").html("");$("#HearingDetailsDiv").html(n)})}$(document).ready(function(){var n=parseInt($("#RequestForProceedingId").val());GetDetails(n);GetNoticeDetails(n);GetEvidenceDetails(n);GetHearingDetails(n)});